				var fechaSalida = new Date(fechaEntrada);
				fechaSalida.setTime(fechaSalida.getTime()+numNoches*24*60*60*1000);
				dia = fechaSalida.getDate();
				if(dia<=9) dia='0'+dia;
				mes=fechaSalida.getMonth()+1;
				if(mes<=9) mes='0'+mes;
				nuevaFecha=dia+'/'+mes+'/'+fechaSalida.getFullYear();
				$(".to_datepicker").val(nuevaFecha);
				var styledDateTo = $.datepicker.formatDate('<span class="aa">dd</span><span class="ee"><span class="ii">MM</span><span class="uu">DD</span></span>', $(".to_datepicker").datepicker('getDate'));
